(79, 14, 1, 0, 0.00, 'A vitamin', '', '', '', 0.00, 'hu'),
(80, 14, 2, 0, 0.00, '', 'A vitamin olyan szerves vegyület, amely kis mennyiségben ugyan, de nélkülözhetetlen az emberi szervezet számára, viszont kellő mennyiségben az előállítására nem mindig képes, ezért tápanyag formájában kénytelen hozzájutni.\r\n<br>\r\n<br>A vitaminokat nem kémiai szerkezetük, hanem biokémiai aktivitásuk alapján osztályozzák, ezért egy bizonyos vitaminnak akár több, azonos hatású vegyületet is tekinthetünk, amire jó példa az A-vitamin hat vitamerje. Van olyan vitamin, amit bizonyos feltételek mellett képes a szervezet előállítani, példa erre ember esetében a D-vitamin és a napsütés kapcsolata. Van olyan anyag, amely az egyik élőlény számára vitamin, a másiknak pedig nem. Erre példa a C-vitamin, amelyet a legtöbb állat szervezete képes előállítani, de az ember nem. Az esszenciális aminosavak, és az esszenciális zsírsavak nem számítanak vitaminnak, mert nagy mennyiségben van szükség rájuk. Mára tizenháromra csökkent a tudomány által elismert vitaminok száma.', '', '', 0.00, 'hu'),
