(279, 51, 1, 0, 0.00, 'FiiO X7 Mark II', '', '', '', 0.00, 'hu'),
(280, 51, 2, 0, 0.00, '', '<p>\r\n\r\nX7 Mark IIA FiiO újraértékelte a digitális/analóg átalakítót az elődhöz képest. Még mindig az ESS-től származik, de most a legújabb generáció: a 8 csatornás ESS 9028PRO DAC. Ezúttal egy jó minőségű, szigorúan kiválasztott stúdióváltozatot választott. Így számítógépről vagy a laptopról is használhatja, a D/A átalakító USB-DAC-ként is.Változások az elődhöz képest:\r\n\r\n</p><p>A memória megduplázódott (1 GB-ról 2 GB-ra)</p><p>A belső memória megduplázódott (32 GB-ról 64 GB-ra)</p><p>A memóriakártyák száma megduplázódik (1-ről 2-re)</p><p>A WLAN kapcsolatok száma megduplázódott (most 2,4 GHz-re és 5 GHz-re)</p><p>A digitális kimenetek száma megduplázódott (koaxiális és optikai digitális kimenet)</p><p>A fejhallgató-csatlakozások száma megduplázódott (most aszimmetrikus és szimmetrikus)</p><p></p><p>\r\n\r\nALAPOS ÁTALAKULÁS, KÍVŰL ÉS BELÜL EGYARÁNT&nbsp; Android alapú, nagyfelbontású, veszteségmentes, hordozható lejátszó. 2GB RAM, 64 GB belső memória és 2db microSD kártyahely. (maximum: 2x256GB)Az X7 MARK II-ben, egy teljesen új erősítő modul az AM3A található, amely kiegyensúlyozott fejhallgató kimenettel rendelkezik.Az AM3A a széles körben elismert AD8620 precíziós, széles sávszélességű JFET operációs erősítőt, valamint a személyre szabott OPA926 op-erősítőt használja,amelyet kizárólag az X7 MARK II számára terveztek. &nbsp;Fejhallgató impedancia:16 -150 ohm (AMP modultól függően változhat)Teljesítmény:200 mW (16 ohm) 100 mW (32 ohm)Frekvencia átvitel:20 Hz - 20 kHzMintavétel:384 kHz/64 bit (DSD:5.6 MHz/1 bit)Fájl formátumok:DSD64/128（iso, dsf, dff) DXD, APE, ALAC, FLAC, AIFF, WAV, WMA, MP2, MP3, AAC, OGGTorzítás (THD+N):＜0.0008% (32/1 kHz)Jel/zaj viszony (SNR):≥115 dBMemória:64 GB belső + max. 2x256 GB microSDÁramellátás:3800 mAh Li-Poly akkumulátorMéret:130 mm × 64 mm × 16.6 mmTömeg:220 gÍgy is ismerheti: X 7 Mark II, X7MarkII\r\n\r\n</p><p>\r\n\r\n<!--StartFragment--><!--EndFragment-->\r\n\r\n</p>', '', '', 0.00, 'hu'),
