(2, 'A vitamin', '<p>\r\n\r\nA&nbsp;vitamin&nbsp;olyan&nbsp;szerves vegyület, amely kis mennyiségben ugyan, de nélkülözhetetlen az emberi szervezet számára, viszont kellő mennyiségben az előállítására nem mindig képes, ezért&nbsp;tápanyag&nbsp;formájában kénytelen hozzájutni.</p><p>A vitaminokat nem&nbsp;kémiai&nbsp;szerkezetük, hanem biokémiai aktivitásuk alapján osztályozzák, ezért egy bizonyos vitaminnak akár több, azonos hatású vegyületet is tekinthetünk, amire jó példa az&nbsp;A-vitamin&nbsp;hat&nbsp;vitamerje. Van olyan&nbsp;vitamin, amit bizonyos feltételek mellett képes a szervezet előállítani, példa erre ember esetében a&nbsp;D-vitamin&nbsp;és a napsütés kapcsolata. Van olyan anyag, amely az egyik élőlény számára vitamin, a másiknak pedig nem. Erre példa a&nbsp;C-vitamin, amelyet a legtöbb állat szervezete képes előállítani, de az ember nem. Az&nbsp;esszenciális aminosavak, és az&nbsp;esszenciális zsírsavak&nbsp;nem számítanak vitaminnak, mert nagy mennyiségben van szükség rájuk. Mára tizenháromra csökkent a tudomány által elismert vitaminok száma.A vegyes táplálkozás általában fedezi a vitaminszükségletet, de az étrend összeállításánál nemcsak arra kell törekedni, hogy a táplálék nyersanyaga vitaminban gazdag legyen, hanem figyelemmel kell lenni arra is, hogy az ételek elkészítése során – főleg a hevítés hatására – a vízben oldódó vitaminok 10-50%-a is elbomolhat, elveszhet. Az egészséges szervezet működéséhez nemcsak vitaminokra, hanem&nbsp;ásványi anyagokra,&nbsp;kofaktorokra&nbsp;és&nbsp;nyomelemekre&nbsp;is szükség van.\r\n\r\n</p>', '', 'sRFoW7PAYac', 6.8, 11, 6.8, 0.16, '', '', 14),
(3, 'B vitamin', '<div>Fedezd fel a&nbsp;<strong>Sbelta Plus kollagén és hialuronsav táplálékkiegészítőt (14 adag)</strong> és mutasd meg milyen ragyogó bőröd van! Ez az <strong>étrend-kiegészítő </strong>javít a bőr hidratáltáságán, rugalmasságán és megfiatalodásán, így elhalasztja és csökkenti a ráncok kialakulását. Ráadásul igazán jótékony hatással van a csontokra, ínakra, ínszalagokra és porcokra, ugyanis megerősíti az izületeket és revitalizálja a szöveteket. Összetevőinek hála hajad és körmeid is egészségesebbek lesznek.&nbsp;14 egyenként 30 ml-es adagot tartalmaz.</div>', '', '', 9, 16, 8, 0.58, '', '', 15),
