(10, 'Tristar HD2349 Ionos Hajszárító', '<p style=\"margin-bottom: 0cm\">Ha a dropshipping üzletedben hajápolási termékeket forgalmazol, a nagykereskedelmi áron kapható <strong>Tristar HD2349 ionos hajszárító</strong> elengedhetetlen része a kínálatodnak! Akasztóval, LED világítással és diffúzorral rendelkezik. Kb. méretek: 21 x 8 x 27 cm. A kábel kb. hossza: 2 m.</p><p>Tulajdonságok: </p><ul><li>Teljesítmény: 2200 W</li><li>Feszültség: 220-240 V</li><li>Rezgésszám: 50-60 Hz</li><li>2 sebességi fokozat</li><li>2 hőmérséklet</li><li>Hideg levegő gomb</li><li>Kivehető szűrő</li><li>Túlmelegedés elleni védelem</li></ul>', '', '', 22.1, 26.5, 10, 0.84, '', '', 22),
(11, 'Sbelta Plusz Barnító Kapszula (60 db)', '<p>Hogyha szeretnéd mutogatni a szép barna bőrödet, akkor a <strong>Sbelta Plus barnító kapszula (60 db)</strong> segít majd elérni a célodat. A kapszulában tartalmazott B3, C és A vitaminoknak köszönhetően a bőröd melanin tartalma  és a bőröd barnasága is megnő. Hatvan kapszult tartalmaz.</p>', '', '', 4.5, 8.5, 4.5, 0.06, '', '', 23),
(12, 'KK vitamin', 'A vitamin olyan szerves vegyület, amely kis mennyiségben ugyan, de nélkülözhetetlen az emberi szervezet számára, viszont kellő mennyiségben az előállítására nem mindig képes, ezért tápanyag formájában kénytelen hozzájutni.\r\n<br>\r\n<br>A vitaminokat nem kémiai szerkezetük, hanem biokémiai aktivitásuk alapján osztályozzák, ezért egy bizonyos vitaminnak akár több, azonos hatású vegyületet is tekinthetünk, amire jó példa az A-vitamin hat vitamerje. Van olyan vitamin, amit bizonyos feltételek mellett képes a szervezet előállítani, példa erre ember esetében a D-vitamin és a napsütés kapcsolata. Van olyan anyag, amely az egyik élőlény számára vitamin, a másiknak pedig nem. Erre példa a C-vitamin, amelyet a legtöbb állat szervezete képes előállítani, de az ember nem. Az esszenciális aminosavak, és az esszenciális zsírsavak nem számítanak vitaminnak, mert nagy mennyiségben van szükség rájuk. Mára tizenháromra csökkent a tudomány által elismert vitaminok száma.', '', '', 0, 0, 0, 0, '', '', 24),
