(23, 'Relax Air Flow Sandal Papucs', '<p>Gondoskodj lábaidról a kényelmes <strong>Relax Air Flow Sandal </strong><strong>papuccsal</strong>! Ez a <strong>zselés papucs </strong>viszkoelasztikus habból készült, és csökkenti a sétálás hatását, ugyanis enyhíti a lábfejre, bokára, lábra, térdre nehezedő nyomást. Tökéletes papucs, mely igazán kényelmes és megnyogtató lábaidnak! Lélegző anyagból készült. A talpak csúszás mentes gumiból készültek. Kb. hossz: S: 25 cm - M: 27 cm - L: 29 cm</p><p><strong><a href=\"http://www.relaxslippers.com/\">www.relaxslippers.com</a></strong></p>', '', '', 9.5, 32, 13.5, 0.51, 'M', '', 36),
