(25, 'Sbelta Plus Afrikai Mangó Táplálékkiegészítő (60 kapszula)', '<p>Ha természetes és egészséges módon szeretnél <strong>fogyni</strong>, ne maradj le a <strong>Sbelta Plus afrikai mangó táplálékkiegészítőről</strong> <strong>(60 kapszula)</strong>. Az afrikai mangó magjában megtalálható IGOB131 vegyületnek hála javul majd az emésztésed és segít megelőzni a test zsírtermelését. 60 kapszulát tartalmaz.</p>', '', '', 4.5, 8.7, 4.5, 0.05, '', '', 39),
(26, 'Sbelta Plus Kollagén és Magnézium Táplálékkiegészítő (60 tabletta)', '<p>Ne maradj le a <strong>Sbelta Plus</strong> <strong>kollagén és magnézium táplálékkiegészítőről (60 tabletta)</strong> és legyen ragyogó bőröd! Ez az <strong>étrend-kiegészítő </strong>javítja a bőr hidratáltságát, ellenállását és rugalmasságát, és csökkenti a ráncosodást. Továbbá hatékonyan erősíti a csontokat, ínakat, porcokat, hajat és körmöket. A magnézium javítja az izmok működését. 60 tablettát tartalmaz.</p>', '', '', 4.4, 8.7, 4.4, 0.08, '', '', 40),
(27, 'Sbelta Plus Kollagénes és Hialuronsavas Étrend-kiegészítő (120 tabletta)', '<p>Ha <strong>természetes termékekere</strong> van szükséged a diétád kiegészítéséhez, biztos választás a <strong>Sbelta Plus kollagénes és hialuronsavas étrend-kiegészítő (120 tabletta)</strong>. Természetes összetevői biztosítják a bőr, haj és körmök egészségét és szépségét. Ez az étrendkiegészítő kiváló a csontok, inak, szalagok és oprcok erősítésére és regenerációjára. Nagyszerű hidratálást, rugalmasságot, vitalitást és feszességét biztosít a bőrnek, gátolva öregedését. 120 tablettát tartalmaz.</p><p> </p>', '', '', 6.8, 11, 6.8, 0.16, '', '', 41),
(28, 'Sbelta Plus Kollagén és Hialuronsav Táplálékkiegészítő (14 adag)', '<div>Fedezd fel a <strong>Sbelta Plus kollagén és hialuronsav táplálékkiegészítőt (14 adag)</strong> és mutasd meg milyen ragyogó bőröd van! Ez az <strong>étrend-kiegészítő </strong>javít a bőr hidratáltáságán, rugalmasságán és megfiatalodásán, így elhalasztja és csökkenti a ráncok kialakulását. Ráadásul igazán jótékony hatással van a csontokra, ínakra, ínszalagokra és porcokra, ugyanis megerősíti az izületeket és revitalizálja a szöveteket. Összetevőinek hála hajad és körmeid is egészségesebbek lesznek. 14 egyenként 30 ml-es adagot tartalmaz.</div>', '', '', 9, 16, 8, 0.58, '', '', 42),
