(18, 3, 2, 0, 0.00, '', '<p>Edezd fel a <strong>Dr Gem Acu Spots masszázs papucs</strong>ot, és élénkítsd a testedet egyszerűen sétálva! A papucsok kialakítása a láb reflexológia elvein alapul, egy több ezer éves olyan módszer, amely az ősi Kínából, Egyiptomból és az USA-ból származik. 82 akupresszúrás ponttal rendelkezik (41 db / papucs), amelyek a láb különböző részeire gyakorolt nyomással jótékony hatást keltenek más testrészekre és szervekre is. PVC-ből és szövetből készült, csatos rögzítéssel lehet a lábhoz beállítani. Tökéletes a stressz és az idegfeszültség enyhítéséhez, méregtelenítéshez, a vérkeringés, az immunrendszer és az endokrin rendszer élénkítéséhez. Emellett ellazítja az izmokat és javítja az alvás minőségét. A csomag egy párt tartalmaz (mindkét lábra egy-egy).</p><p><strong><a href=\"http://www.dr-gem.com/\">www.dr-gem.com</a></strong></p><p>Méretek:</p><ul><li>S:    38/39 </li><li>M:    40/41  </li><li>L:    42/43</li></ul><p> </p>', '', '', 0.00, 'hu'),
